import Vue from 'vue'
import App from './App.vue'
import Slider from "@/components/Slider";
import Slide from "@/components/Slide";

Vue.config.productionTip = false

new Vue({
  Slider,
  Slide,
  render: h => h(App),
}).$mount('#app')
